<template lang="">
    <div class="Conter">
        <form>
            <p> Nombre Driver: <input type="text" v-model="booked.driver" size="40" /></p>
            <p> Pick up Inicial (Nombre Hotel): <input type="text" v-model="booked.pickupI" size="40" /></p>
            <p> Pick up Final (Nombre Hotel): <input type="text" v-model="booked.pickupF" size="40" /></p>
            <p> Nombre Cliente: <input type="text" v-model="booked.cliente" size="40" /></p>
            <p> Fecha de pick up: <input type="date" v-model="booked.fecha" size="40" /></p>
            <p> Hora de pick up: <input type="time" v-model="booked.hora_pickup" size="40" /></p>
            <p> Balance: <input type="number" v-model="booked.balance" size="10" /></p>
            <p> Pax: <input type="number" v-model="booked.pax" size="10" /></p>
            <p> Moneda: <select v-model="booked.moneda">
                <option >USD</option>
                <option >MXN</option>
            </select></p>

        </form>
        <p>
                <button v-on:click="generatePDF"> Crear PDF</button>
        </p>
    </div>

</template>
<script>

import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

pdfMake.vfs = pdfFonts.pdfMake.vfs;

export default {
  methods: {
    generatePDF(){

        const fecha = new Date();
        const mesActual = Intl.DateTimeFormat('es-ES',{month:'long'}).format(fecha)  ;
        const day = fecha.getDate();
        const year = fecha.getFullYear();


        let docDefinition = {
            content: [

                {
                    image: 'logo_name',
                    width: 200
                },
                `\n\nCancún Quintana Roo ${day} de ${mesActual} ${year}.\n\n\n\n`,
                
                {text: 'ORDEN DE SERVICIO. \n\n\n\n', style: 'header',alignment: 'center'},
                
                
                {
                    style: 'tableExample',
                    table: {
                            widths: [250,250],
                            heights: [20,20, 50, 70],
                            body: [
                                ['SERVICE', 'Transportación Privada'],
                                ['AGENCIA', 'TOURSGOMX'],
                                ['OPERADOR', this.booked.driver],
                                ['', `Name: ${this.booked.cliente} \nHotel Salida: ${this.booked.pickupI}\nHotel llegada: ${this.booked.pickupF}\nPickup: ${this.booked.fecha} ${this.booked.hora_pickup}\nPax: ${this.booked.pax}\nBalance: ${this.booked.balance} ${this.booked.moneda}`  
                                ]
                            ]
                        }
                },

                {
                    stack: [
                        {text: 'BLVD Kukulkan Zona Hotelera Cancún Quintana Roo', style: 'footer'},
                    ],
                    style: 'header'
                },

            ],

            styles: {
                        header: {
                            fontSize: 18,
                            bold: true
                        },
                        subheader: {
                            fontSize: 15,
                            bold: true
                        },
                        quote: {
                            italics: true
                        },
                        small: {
                            fontSize: 8
                        },
                        footer:{
                            fontSize: 12,
                            bold: true,
                            alignment: 'left',
                            margin: [0, 100, 0, 80]
                        }
            },

            images: {
                logo_tucan: 'data:image/png;base64,'
                ,logo_name: 'data:image/png;base64,'
             }

        };

        const pdf = pdfMake.createPdf(docDefinition)
        const codigo = this.booked.cliente.substring(0,3).toLocaleUpperCase()
        pdf.download(`${day}${codigo}.pdf`)
    }
  },
  data () {
    return {
        counter: 0,
        booked:
            {
                moneda:'',
                driver:'',
                pickupI:'',
                pickupF:'',
                cliente:'',
                fecha: '',
                hora_pickup:'',
                balance:'',
                pax:'',
                
            }
        
    }
  },
    
    
}
</script>


